        <h1>Principais pontos turístisco de Florianópolis</h1>

        <span class=""material-icons"">star</span> <span class=""material-icons"">star</span> <span class=""material-icons"">star</span><span class=""material-icons"">star</span> <span class=""material-icons"">star_outline</span>

        <p><strong>Florianópolis</strong> é uma das capitais mais bonitas e com melhor qualidade de vida do Brasil. A cidade une uma estrutura moderna e praias incríveis, e quem visita fica até perdido em meio a tantas opções para conhecer. Para te ajudar, preparamos uma lista com os 10 opções de pontos turísticos.</p>

        <p>Se engana quem pensa que o turismo na ilha é baseado somente em suas praias. É verdade que são o principal atrativo, mas existe muito mais espalhado pela área total de Floripa, co");
            WriteLiteral(@"m 55km de comprimento e 18km de largura. São construções e vilarejos históricos, mangues, lagoas e uma série de lugares turísticos para preencher seus dias de férias na ilha da magia.</p>

